    "2015-06-19T13:50:03.242573",nt"name": "terrain-providence-county-rhode-island",nt"isopen":
    false,nt"url": null,nt"notes": "The Providence AOI consists of the costal
    portion of the county, and meshes up seamlessly with the Kent county AOI directly
    south. Ground Control is collected throughout the AOI for use in the processing
    of LiDAR data to ensure data accurately represents the ground surface. QA/QC checkpoints,
    (FVA and CVA - see Ground Control process step for further information) also collected
    throughout the AOI, are used for independent quality checks of the processed LiDAR
    data. The Bare Earth deliverables consists of tiles of fully classified LAS points.
    A suite of products derived from the LiDAR data including DEMs and contour data
    has been created to support H&H analysis within the county. A full narrative accompanies
    this deliverable, as well as the independent QC report.",nt"license_title":
